function listbox1_Callback(hObject, eventdata, handles)
set(handles.text22,'Visible',false);
set(handles.text26,'Visible',false);
set(handles.text23,'Visible',false);
set(handles.text36,'Visible',false);

[num,txt] = xlsread('ВВП стран');
val = get(hObject,'Value');
s = size(val);

size2 = size(num);
min1 = 100;
min2 = 100;
max1 = 0;
max2 = 0;
if (s(2) >= 2)
    set(hObject,'Value',val(1,1:2));
    val = get(hObject,'Value');
    set(handles.text34,'String',txt(val(1,1)+1));
    set(handles.text35,'String',txt(val(1,2)+1));
    
    set(handles.text30,'String',txt(val(1,1)+1));
    set(handles.text31,'String',txt(val(1,2)+1));
    for i = 2:size2(2)
        if ((num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100 < min1)
            if ((num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100 > 0)
                min1 = (num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100;
            end
        end
        if (num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100 > max1
            max1 = (num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100;
        end
        
        if (num(val(1,2)+1,i)/ num(val(1,2)+1,i-1))* 100 - 100 < min2
            if ((num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100 > 0)
                min2 = (num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100;
            end
        end
        if (num(val(1,2)+1,i)/ num(val(1,2)+1,i-1))* 100 - 100 > max2
            max2 = (num(val(1,2)+1,i)/ num(val(1,2)+1,i-1))* 100 - 100;
        end
    end
    set(handles.text22,'String', max1);
    set(handles.text26,'String', min1);
    set(handles.text23,'String',max2 );
    set(handles.text36,'String',min2);
else
    set(handles.text34,'String',txt(val(1,1)+1));
    
    set(handles.text30,'String',txt(val(1,1)+1));
    set(handles.text31,'String','Страна');
    for i = 2:size2(2)
       if (num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100 < min1
           if ((num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100 > 0)
               min1 = (num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100;
           end
       end
       if (num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100 > max1
           max1 = (num(val(1,1)+1,i)/ num(val(1,1)+1,i-1))* 100 - 100;
       end
    end
    set(handles.text22,'String', max1);
    set(handles.text26,'String', min1);
    set(handles.text23,'String',0);
    set(handles.text36,'String',0);
end
axes(handles.axes15);
x=num(1,:);
y1=num(get(hObject,'Value')+1,:);
plot(x,y1);

x1 = num(1,2:size2(2));
axes(handles.axes17);
y21 = (num(get(hObject,'Value')+1,2:size2(2))./ num(get(hObject,'Value')+1,1:size2(2)-1)).* 100 - 100;
plot(x1,y21);
end


